import React from 'react';
import './Problem.css';
const Problem = (props) =>{
    const prob=props.prob;
    return(
        <tr className={`problem-component ${props.attemp?(props.solved?"solved":"unsolved"):""}`}>
        {prob.id+prob.title+prob.difficulty} </tr>
    )
}

export default Problem;
